    return (
        <div className='banner' id='home'>
            <Container>
                <Row className='greeting'>
                    <Col >
                        <h1>Parkside</h1>
                        <h2>Cafe and Sushi</h2>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}
